import { useState } from "react";

import { ClientApi } from "../../../api/clientApi";

function TrackerSearch({ onDataFetch }) {
  const [formData, setFormData] = useState({
    gameName: "",
    tagLine: "",
  });


  const handleChange = (event) => {
    const { name, value } = event.target;
    setFormData({
      ...formData,
      [name]: value,
    });
  };

  const handleSubmit = async (event) => {
    event.preventDefault();
    console.log(formData);
    const account = await ClientApi.fetchRiotAccount(
      formData.gameName,
      formData.tagLine
    );
    console.log(account);

    const matchHistory = await ClientApi.fetchMatches(account.puuid)
    console.log(matchHistory)
    onDataFetch(account);

  };

  return (
    <form onSubmit={handleSubmit} className="TrackerSearch">
      <input
        className="gameNameInput"
        name="gameName"
        type="text"
        onChange={handleChange}
        placeholder="Summoner name"
      />
      <input
        className="tagLineInput"
        name="tagLine"
        type="text"
        onChange={handleChange}
        placeholder="#tag"
      />
      <button type="submit">Search</button>
    </form>
  );
}
export default TrackerSearch;
